import React, { useEffect, useRef, useState } from 'react';
import { Line, Bar, Pie, Area, Column, DualAxes, Scatter } from '@ant-design/charts';

const ChartRenderer = ({ chart, title }) => {
  const [isLoading, setIsLoading] = useState(true);
  const containerRef = useRef(null);

  useEffect(() => {
    // Simulate loading for smooth transition
    const timer = setTimeout(() => setIsLoading(false), 300);
    return () => clearTimeout(timer);
  }, [chart]);

  if (!chart) {
    return (
      <div className="chart-error p-8 text-center text-gray-500">
        No chart data available
      </div>
    );
  }

  const { type, data, config } = chart;

  // Default configurations for different chart types
  const defaultConfigs = {
    line: {
      data: data || [],
      xField: config?.xField || 'x',
      yField: config?.yField || 'y',
      smooth: true,
      animation: {
        appear: {
          animation: 'path-in',
          duration: 1000,
        },
      },
      point: {
        size: 4,
        shape: 'circle',
        style: {
          fill: 'white',
          stroke: '#5B8FF9',
          lineWidth: 2,
        },
      },
      tooltip: {
        showMarkers: true,
      },
      ...config,
    },
    bar: {
      data: data || [],
      xField: config?.xField || 'value',
      yField: config?.yField || 'category',
      seriesField: config?.seriesField,
      legend: config?.seriesField ? { position: 'top-left' } : false,
      animation: {
        appear: {
          animation: 'scale-in-x',
          duration: 800,
        },
      },
      ...config,
    },
    pie: {
      data: data || [],
      angleField: config?.angleField || 'value',
      colorField: config?.colorField || 'type',
      radius: 0.8,
      label: {
        type: 'outer',
        content: '{name} {percentage}',
      },
      interactions: [
        { type: 'pie-legend-active' },
        { type: 'element-active' },
      ],
      animation: {
        appear: {
          animation: 'fade-in',
          duration: 800,
        },
      },
      ...config,
    },
    area: {
      data: data || [],
      xField: config?.xField || 'x',
      yField: config?.yField || 'y',
      smooth: true,
      areaStyle: {
        fillOpacity: 0.6,
      },
      animation: {
        appear: {
          animation: 'wave-in',
          duration: 1000,
        },
      },
      ...config,
    },
    scatter: {
      data: data || [],
      xField: config?.xField || 'x',
      yField: config?.yField || 'y',
      colorField: config?.colorField,
      sizeField: config?.sizeField,
      size: [4, 30],
      shape: 'circle',
      yAxis: {
        nice: true,
      },
      xAxis: {
        nice: true,
      },
      ...config,
    },
  };

  const renderChart = () => {
    const chartConfig = defaultConfigs[type] || defaultConfigs.line;

    switch (type) {
      case 'line':
        return <Line {...chartConfig} />;
      case 'bar':
        return <Bar {...chartConfig} />;
      case 'column':
        return <Column {...chartConfig} />;
      case 'pie':
        return <Pie {...chartConfig} />;
      case 'area':
        return <Area {...chartConfig} />;
      case 'scatter':
        return <Scatter {...chartConfig} />;
      case 'dual-axes':
        return <DualAxes {...chartConfig} />;
      default:
        // Default to line chart
        return <Line {...chartConfig} />;
    }
  };

  return (
    <div ref={containerRef} className="chart-renderer">
      {title && (
        <div className="chart-header mb-4 flex justify-between items-center">
          <h3 className="text-lg font-semibold text-gray-800">{title}</h3>
          <div className="flex space-x-2">
            <button
              onClick={() => downloadChartAsImage(containerRef.current)}
              className="p-2 text-gray-500 hover:text-gray-700 hover:bg-gray-100 rounded transition-colors"
              title="Download as image"
            >
              <svg className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16v1a3 3 0 003 3h10a3 3 0 003-3v-1m-4-4l-4 4m0 0l-4-4m4 4V4" />
              </svg>
            </button>
            <button
              onClick={() => toggleFullscreen(containerRef.current)}
              className="p-2 text-gray-500 hover:text-gray-700 hover:bg-gray-100 rounded transition-colors"
              title="Fullscreen"
            >
              <svg className="w-5 h-5" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5l-5-5m5 5v-4m0 4h-4" />
              </svg>
            </button>
          </div>
        </div>
      )}

      {isLoading ? (
        <div className="chart-loading h-64 bg-gray-100 rounded-lg animate-pulse" />
      ) : (
        <div className="chart-container min-h-[300px]">
          {renderChart()}
        </div>
      )}

      {/* Chart Description */}
      {chart.description && (
        <div className="mt-4 p-3 bg-gray-50 rounded-lg">
          <p className="text-sm text-gray-600">{chart.description}</p>
        </div>
      )}
    </div>
  );
};

// Helper functions
const downloadChartAsImage = (element) => {
  if (!element) return;

  // This is a placeholder - actual implementation would use html2canvas or similar
  console.log('Download chart as image');
  // You could implement this with html2canvas library
};

const toggleFullscreen = (element) => {
  if (!element) return;

  if (!document.fullscreenElement) {
    element.requestFullscreen().catch(err => {
      console.error('Error attempting to enable fullscreen:', err);
    });
  } else {
    document.exitFullscreen();
  }
};

export default ChartRenderer;
